script: |
  super -f text -I q688.spq | sort > q688.out

inputs:
  - name: q688.spq
    data: |
      SELECT DISTINCT - 1 * - 48 + + col0 / - 19 AS col0 FROM tab1 (FORMAT parquet) WHERE + col2 * col0 - ( col0 + col2 ) / 2 BETWEEN - 26 + col2 AND - 87 + col1;
  - name: tab1

outputs:
  - name: q688.out
    data: |
